import React, { Component, Fragment }from 'react';


class Nav extends Component {

    state = {
        count: 20
    };

    render = () => {
        const { count } = this.state;
        return (
            <Fragment>
                <div>Nav</div>
            </Fragment>
        )
    }
}

export default Nav;
